	return (
		<Container>
          <Navbar.Brand href="#home">
            <img
              alt=""
              src={devLogo}
              width="30"
              height="30"
              className="d-inline-block align-top"
            />{' '}
            React Bootstrap
          </Navbar.Brand>
        </Container>
	);
};

export default MainNav;
